import React, { useState } from "react";
import "./ToggleStyle.css";
function Toggle() {
    return (
        <div>
            <div className="toggle">
                <div className="spinner"></div>
            </div>
            <div className="toggle-on">On</div>
            <div className="toggle-off">Off</div>
        </div>
    );
}
export default Toggle;
